import {AppBar, Box, Toolbar, IconButton, Typography, Menu, Container, Avatar, Button, Grid, Paper, Link, MenuItem} from '@mui/material';
import ken from '../images/ken.jpg';
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import MenuIcon from '@mui/icons-material/Menu';
import { experimentalStyled as styled } from '@mui/material/styles';
import ScienceIcon from '@mui/icons-material/Science';
import WorkIcon from '@mui/icons-material/Work';
import SchoolIcon from '@mui/icons-material/School';
import Timeline from '@mui/lab/Timeline';
import TimelineItem from '@mui/lab/TimelineItem';
import TimelineSeparator from '@mui/lab/TimelineSeparator';
import TimelineConnector from '@mui/lab/TimelineConnector';
import TimelineContent from '@mui/lab/TimelineContent';
import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';
import TimelineDot from '@mui/lab/TimelineDot';
import DescriptionIcon from '@mui/icons-material/Description';
import Resume from './components/resume.pdf';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(5),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

// const pages = ['ABOUT', 'PROJECT'];
// const links = {'ABOUT': '/about', 
//                'PROJECT': '/project'};
const skills = ['Python', 'Pytorch', 'Tensorflow', 'Javascript', 'React', 'Node.js', 'HTML', 'CSS', 'Postman', 'SQL', 'Java', 'Docker', 'Git'];

// const pages = ['ABOUT', 'PROJECT'];
// const links = {'ABOUT': '/about', 
//                'PROJECT': '/project'};



function App() {

  const [anchorElNav, setAnchorElNav] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  return (
    <Container maxWidth={false} disableGutters>
      <AppBar position="static"
      sx={{bgcolor: 'rgb(46, 59, 85)'}}>
        <Container maxWidth="xl"
        sx={{margin: '0px'}}>
          <Toolbar disableGutters>
            <Typography
              variant="h6"
              noWrap
              component="a"
              href="/"
              sx={{
                mr: 2,
                display: { xs: 'none', md: 'flex' },
                fontFamily: 'monospace',
                fontWeight: 700,
                fontSize: '1.25rem',
                letterSpacing: '.3rem',
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              JEONGHOON KIM
            </Typography>

            {/* <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
              <IconButton
                size="large"
                aria-label="account of current user"
                aria-controls="menu-appbar"
                aria-haspopup="true"
                onClick={handleOpenNavMenu}
                color="inherit"
              >
                <MenuIcon />
              </IconButton>
              <Menu
                id="menu-appbar"
                anchorEl={anchorElNav}
                anchorOrigin={{
                  vertical: 'bottom',
                  horizontal: 'left',
                }}
                keepMounted
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'left',
                }}
                open={Boolean(anchorElNav)}
                onClose={handleCloseNavMenu}
                sx={{
                  display: { xs: 'block', md: 'none' },
                }}>
                {pages.map((page) => (
                  <MenuItem key={page} onClick={handleCloseNavMenu}>
                    <Typography textAlign="center" href={links[page]}> { }
                      {page}
                    </Typography>
                  </MenuItem>  
                ))}
              </Menu>
            </Box> */}

            <Typography
              variant="h5"
              noWrap
              component="a"
              href=""
              sx={{
                mr: 2,
                display: { xs: 'flex', md: 'none' },
                flexGrow: 1,
                fontFamily: 'monospace',
                fontWeight: 700,
                letterSpacing: '.3rem',
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              JEONGHOON KIM
            </Typography>
            {/* <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
              {pages.map((page) => (
                <Button 
                  key={page}
                  onClick={handleCloseNavMenu}
                  href={links[page]}
                  sx={{ my: 2, color: 'white', display: 'block', fontSize: '0.875rem' }}
                >
                  {page}
                </Button>
              ))}
            </Box> */}


          </Toolbar>
        </Container>
      </AppBar>
      <Container maxWidth={false}
      sx={{ 
        marginTop: '80px',
        textAlign: 'center', 
        mx: '0px'
      }}>
        {/* image container */}
        <Container 
        sx={{justifyContent: "center",
        display: "flex"}}>
          <Avatar
            alt="No photo available"
            src={ken}
            sx={{ width: 300, height: 300}}
            >KEN
          </Avatar>
        </Container>

        <Typography variant='h2'
        sx={{
          margin: '16px',
          fontWeight: 700,
          fontSize: '30px',
          lineHeight: 1.5,
          color: 'rgb(46, 59, 85)',
          // letterSpacing: '2px',
          textDecoration: 'none',
        }}>
          Jeonghoon Kim
        </Typography>

        <Typography variant='h5'
        sx={{
          margin: '0px 0px 0px 0px',
          fontWeight: 400,
          lineHeight: 1.5,
          fontSize: '1rem',
          textDecoration: 'none',
        }}>
          Senior Stuedent at University of Minnesota, Twin-Cities
        </Typography>
        <Typography variant='h5'
        sx={{
          margin: '0px 0px 8px 0px',
          fontWeight: 400,
          lineHeight: 1.5,
          fontSize: '1rem',
          textDecoration: 'none',
        }}>
          Living in Minneapolis, Minnesota
        </Typography>

        {/* Buttons */}
        <Container sx={{display: 'flex', justifyContent:'center', marginTop: '16px'}}>
          <Button variant="outlined" color='success' href="https://github.com/junghun-K" sx={{minWidth:'80px', padding: '3px 9px'}}>
            <GitHubIcon></GitHubIcon>
            <Typography sx={{paddingLeft:'3px', fontSize:'13px'}}>Github</Typography>
          </Button>
          <Button variant="outlined" color='primary' href="mailto:junghun1112@gmail.com" sx={{minWidth:'80px', padding: '3px 9px' , mx: '1.3rem'}}>
            <EmailIcon></EmailIcon>
            <Typography sx={{paddingLeft:'3px', fontSize:'13px'}}>Email</Typography>
          </Button>
          <Button variant="outlined" color='warning' href="https://www.linkedin.com/in/junghun-kim-42362a24b/" sx={{minWidth:'80px', padding: '3px 9px'}}>
            <LinkedInIcon></LinkedInIcon>
            <Typography sx={{paddingLeft:'3px', fontSize:'13px'}}>LinkedIn</Typography>
          </Button>
        </Container>

      </Container>
    </Container>
  );
}

export default App;
